import { Button } from "react-bootstrap";

const Header = (props) => {
  return (
    <>
      <nav class="navbar navbar-expand-lg navbar-dark bg-primary">
        <div class="row">

          <div class="col">
            <a href="/">
              <img
                class="logo"
                src="Assets/img/pokeball.png"
                alt="placeholder logo"
              />
            </a>
          </div>

          <div class="col-6">

          </div>
        </div>
      </nav>
    </>
  );
};

export default Header;
